(153, 'Иванов Иван Иванович', '0', 'Уточнить', 'Иванова Татьяна Ивановна', 'Иванов Иван Иванович', '89123456789', '89123456780', '89123456798', '1', 'Не хочет учится', 'Студент Венедиктов Иванов Иван учится в Санкт-Петербургском государственном Политехническом университете на втором курсе, на кафедре нанотехнологий и квантовой механики. За время учебы показал себя как ответственный студент.\r\n\r\nПринимал участие в культурно-массовых мероприятиях, организовываемых университетом: день первокурсника и день открытых дверей. Член институтской команды КВН.\r\n\r\nПроходил производственную практику во ФГУП «Морские физико-технические системы», зарекомендовал себя как ответственный практикант.\r\n\r\nОсобые способности проявляет в физике, проходил учебную практику в кафедральной лаборатории оптики и фотоники.\r\n\r\nВ контактах с однокурсниками Антон Венедиктов проявляет лидерские качества, неконфликтен, всегда готов помочь друзьям и приятелям.\r\n\r\nВ 2010 году был номинирован на стипендию губернатора Санкт-Петербурга по итогам двух экзаменационных сессий.\r\n\r\nПреподаватели характеризуют Ивана Иванова как способного студента, который в дальнейшем может раскрыть свой инженерный талант в профессиональной сфере при условии интенсивного обучения.', '25.09.2021', 'РФ', 'ЛОЖЬ', '25.09.2021', ''),
